import React, { useState } from 'react';
import { Container, Typography, TextField, Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Link, Box } from '@mui/material';
import { FaTwitter, FaGithub, FaLinkedin } from 'react-icons/fa';

function App() {
  const [link, setLink] = useState('');
  const [results, setResults] = useState(null);

  const handleCalculateMarks = async () => {
    const response = await fetch('http://localhost:3000/api/calculate', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({ link })
    });
    const data = await response.json();
    setResults(data);
  }

  return (
    <Container maxWidth="md" component="main">
      <Typography variant="h3" component="h1" gutterBottom align="center">
        GATE 2024 CSE Marks Calculator
      </Typography>
      <Typography variant="subtitle1" gutterBottom align="center">
        Developed by Pritish Poswal
      </Typography>
      <Box my={2} display="flex" justifyContent="center">
        <FaTwitter />
        <FaGithub />
        <FaLinkedin />
      </Box>
      <TextField
        fullWidth
        label="Response Sheet Link"
        variant="outlined"
        value={link}
        onChange={(e) => setLink(e.target.value)}
        margin="normal"
      />
      <Button
        fullWidth
        variant="contained"
        color="primary"
        onClick={handleCalculateMarks}
      >
        Calculate Marks
      </Button>
      {results && (
        <TableContainer component={Paper} style={{ marginTop: '20px' }}>
          <Table aria-label="results table">
            <TableHead>
              <TableRow>
                <TableCell>Category</TableCell>
                <TableCell align="right">Positive Marks</TableCell>
                <TableCell align="right">Negative Marks</TableCell>
                <TableCell align="right">Attempted</TableCell>
                <TableCell align="right">Correct</TableCell>
                <TableCell align="right">Incorrect</TableCell>
                <TableCell align="right">Total Marks</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {results.map((row) => (
                <TableRow key={row.category}>
                  <TableCell component="th" scope="row">
                    {row.category}
                  </TableCell>
                  <TableCell align="right">{row.positive}</TableCell>
                  <TableCell align="right">{row.negative}</TableCell>
                  <TableCell align="right">{row.attempted}</TableCell>
                  <TableCell align="right">{row.correct}</TableCell>
                  <TableCell align="right">{row.incorrect}</TableCell>
                  <TableCell align="right">{row.total}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
      <footer style={{ marginTop: '20px', textAlign: 'center' }}>
        <Typography variant="body2" color="textSecondary">
          Â© 2024 Developed by Pritish Poswal
        </Typography>
      </footer>
    </Container>
  );
}

export default App;
